import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { getAppointments, createQueue, updateAppointmentStatus } from '../services/api';
import './QueueEntry.css';

const QueueEntry = () => {
    const navigate = useNavigate();
    const [appointments, setAppointments] = useState([]);
    const [customerName, setCustomerName] = useState('');
    const [phone, setPhone] = useState('');
    const [location, setLocation] = useState('Walk-in');
    const [totalPairs, setTotalPairs] = useState(1);
    const [deliveryDate, setDeliveryDate] = useState(() => {
        const tomorrow = new Date();
        tomorrow.setDate(tomorrow.getDate() + 1);
        return tomorrow.toISOString().split('T')[0];
    });
    const [selectedAppointmentId, setSelectedAppointmentId] = useState(null); // ✅ เก็บ ID นัดหมายที่เลือก

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (!token) {
        navigate('/login'); // ถ้าไม่มี Token ให้ Redirect ไปหน้า Login
        }
        fetchAppointments();
    }, []);

    const fetchAppointments = async () => {
        try {
            const res = await getAppointments();
            setAppointments(res.data.filter(appt => appt.status === 'สำเร็จ')); // ✅ ดึงเฉพาะนัดหมายที่สำเร็จ
        } catch (error) {
            console.error("🔴 Error fetching appointments:", error);
        }
    };

    const handleCreateQueue = async () => {
        if (!customerName || !phone || !totalPairs || !deliveryDate) {
            alert("กรุณากรอกข้อมูลให้ครบถ้วน");
            return;
        }

        if (!window.confirm("คุณแน่ใจหรือไม่ว่าต้องการบันทึกคิวนี้?")) return; // ✅ เพิ่มการยืนยัน

        try {
            const newQueue = {
                customer_name: customerName,
                phone,
                location,
                total_pairs: totalPairs,
                delivery_date: deliveryDate
            };
            await createQueue(newQueue);

            // ✅ หากมาจากนัดหมาย อัปเดตสถานะเป็น "รับเข้าแล้ว" (Status = 4)
            if (selectedAppointmentId) {
                await updateAppointmentStatus(selectedAppointmentId, "รับเข้าแล้ว");
            }

            alert("✅ เพิ่มคิวงานเรียบร้อยแล้ว!");
            navigate('/queue'); // ✅ กลับไปหน้าคิว
        } catch (error) {
            console.error("🔴 Error creating queue:", error);
        }
    };

    const handleSelectAppointment = (appointment) => {
        setCustomerName(appointment.customer_name);
        setPhone(appointment.phone);
        setLocation(appointment.location || "Walk-in");
        setTotalPairs(appointment.shoe_count);
        setSelectedAppointmentId(appointment.id); // ✅ บันทึก ID นัดหมายที่เลือก
    };

    return (
        <div className="queue-entry-container">
            <h1>🆕 รับเข้ารองเท้า</h1>
            <button onClick={() => navigate('/queue')}>⬅️ กลับไปหน้าคิว</button>

            <h2>เลือกจากนัดหมาย</h2>
            <ul>
                {appointments.map(appt => (
                    <li key={appt.id} onClick={() => handleSelectAppointment(appt)}>
                        {appt.customer_name} - {appt.phone} ({appt.shoe_count} คู่)
                    </li>
                ))}
            </ul>

            <h2>เพิ่มคิวใหม่ (Walk-in)</h2>
            <input type="text" placeholder="ชื่อ" value={customerName} onChange={(e) => setCustomerName(e.target.value)} />
            <input type="text" placeholder="เบอร์โทร" value={phone} onChange={(e) => setPhone(e.target.value)} />
            <input type="text" placeholder="สถานที่" value={location} onChange={(e) => setLocation(e.target.value)} />
            <input type="number" placeholder="จำนวนคู่รองเท้า" value={totalPairs} onChange={(e) => setTotalPairs(Number(e.target.value))} />
            <input type="date" value={deliveryDate} onChange={(e) => setDeliveryDate(e.target.value)} />
            <button onClick={handleCreateQueue}>บันทึกคิว</button>
        </div>
    );
};

export default QueueEntry;
